static boolean isBlobAlreadyExistsConflict(StorageException e) {
  if (e.getHttpStatusCode() == HttpURLConnection.HTTP_CONFLICT
      && StorageErrorCodeStrings.BLOB_ALREADY_EXISTS.equals(e.getErrorCode())) {
    return true;
  }
  return false;
}
